INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (11, 26224073, 26224, 10, "そうどすえ♪\nみんなで踊りながら、お祝いしまひょ♪\nカスミはんのために、王子はんも\n準備を手伝ってくれたんよ♪", 0, 0.5, 1, 1, 0, 101011);
