INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (11, 34314071, 34314, 10, "ついにこの日がやってきたの～！\n今日はミヤコの誕生日なんだから、\n山のようにプリンを用意して、\n盛大にお祝いするの～♪", 0, 0.5, 1, 1, 0, 100711);
