INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (11, 38614069, 38614, 10, "今日は、私の誕生日を\nお祝いしてくれてありがとう。\nケーキを食べる前に、\n一つだけ質問してもいいかしら？", 0, 0.5, 1, 1, 0, 105111);
